                "type": "zip",
                "url": "https://api.github.com/repos/BrainMaestro/composer-git-hooks/zipball/974e17fcae40dc389d1529e1342f5468d0b7b028",
                "reference": "974e17fcae40dc389d1529e1342f5468d0b7b028",
                "shasum": ""
            },
            "require": {
                "php": "^5.6 || >=7.0",
                "symfony/console": "^3.2 || ^4.0"
            },
            "require-dev": {
                "friendsofphp/php-cs-fixer": "^2.9",
                "phpunit/phpunit": "^5.7|^7.0"
            },
            "bin": [
                "cghooks"
            ],
            "type": "library",
            "extra": {
                "hooks": {
                    "pre-commit": "composer check-style",
                    "pre-push": [
                        "composer test",
                        "appver=$(grep -o -E '\\d.\\d.\\d' cghooks)",
                        "tag=$(git describe --tags --abbrev=0)",
                        "if [ \"$tag\" != \"v$appver\" ]; then",
                        "echo \"The most recent tag $tag does not match the application version $appver\\n\"",
                        "tag=${tag#v}",
                        "sed -i -E \"s/$appver/$tag/\" cghooks",
                        "exit 1",
                        "fi"
                    ]
                }
            },
            "autoload": {
                "psr-4": {
                    "BrainMaestro\\GitHooks\\": "src/"
                },
                "files": [
                    "src/helpers.php"
                ]
            },
